import React from 'react';
import Description from '../components/Description';
import GridDefault from '../components/GridDefault';
import Playwood from '../components/Playwood';

const Product = (props) => {
  return (
    <>
      <GridDefault name="Product Details" />
      <Playwood />
      <Description />
    </>
  )
}
export { Product };
